column74:
@MaxRose4NY CONGRATULATIONS Max Rose on your victory -- all the sweeter because it was an upset to Republicans, who were "Likely" to win, BUT DIDN'T 😃😃
Go forth and make us all proud -- NYC and the USA
Be honest and humble, and don't ever forget why you're there - TO SERVE.

@MaxRose4NY is fiiiiine 😍! 
He had the best campaign team ever, I couldn’t walk a few blocks without humans my age giving me flyers. YOU DESERVED THIS! 🙏🏽

#nycvotes #MidtermElections2018 #MaxRose
